m_medium%3Dtipoftheday%26utm_campaign%3Dpartenariats%26utm_content%3Davalara">More information?</a>\n				</span>\n			</div>\n		</section>\n		<section id="2_avalara" class="panel " style="display:none">\n			<header class="panel-heading">\n				<span class="icon-lightbulb"></span> Tips of the day</header>\n			<div class="panel-body" style="padding:0">\n				<img class="img-responsive" src="https://api.prestashop.com/partner/tipsoftheday/img/logo-avalara.png" style="float:right; margin-left: 5px;">\n				<img src="https://gamification.prestashop.com/api/getAdviceImg/508.png"/>\n				<p><b>How important are your sales tax records?</b></p>\n				<p>Ensure that your process for keeping sales records will help (not hurt) you in the case of a tax audit.</p>\n				<span class="text-right" style="float:right">\n					<a class="btn btn-default" target="_blank" href="https://gamification.prestashop.com/get_advice_link.php?id_advice=508&url=http%3A%2F%2Faddons.prestashop.com%2Fen%2Fbilling-invoicing-prestashop-modules%2F5040-avalara-avatax.html%3Futm_source%3Dback-office%26utm_medium%3Dtipoftheday%26utm_campaign%3Dpartenariats%26utm_content%3Davalara">More information?</a>\n				</span>\n			</div>\n		</section>\n		<section id="3_avalara" class="panel " style="display:none">\n			<header class="panel-heading">\n				<span class="icon-lightbulb"></span> Tips of the day</header>\n			<div class="panel-body" style="padding:0">\n				<img class="img-responsive" src="https://api.prestashop.com/partner/tipsoftheday/img/logo-avalara.png" style="float:right; margin-left: 5px;">\n				<img src="https://gamification.prestashop.com/api/getAdviceImg/508.png"/>\n				<p><b>Did you know there are specific tax rules for each state?</b></p>\n				<p>Product taxability laws are not consistent across state lines—what may be taxable in one state may be exempt in another.</p>\n				<span class="text-right" style="float:right">\n					<a class="btn btn-default" target="_blank" href="https://gamification.prestashop.com/get_advice_link.php?id_advice=508&url=http%3A%2F%2Faddons.prestashop.com%2Fen%2Fbilling-invoicing-prestashop-modules%2F5040-avalara-avatax.html%3Futm_source%3Dback-office%26utm_medium%3Dtipoftheday%26utm_campaign%3Dpartenariats%26utm_content%3Davalara">More information?</a>\n				</span>\n			</div>\n		</section>\n		<section id="4_avalara" class="panel " style="display:none">\n			<header class="panel-heading">\n				<span class="icon-lightbulb"></span> Tips of the day</header>\n			<div class="panel-body" style="padding:0">\n				<img class="img-responsive" src="https://api.prestashop.com/partner/tipsoftheday/img/logo-avalara.png" style="float:right; margin-left: 5px;">\n				<img src="https://gamification.prestashop.com/api/getAdviceImg/508.png"/>\n				<p><b>How can one zip code be miles apart when dealing with taxes?</b></p>\n				<p>A single ZIP code can have multiple tax rates.</p>\n				<span class="text-right" style="float:right">\n					<a class="btn btn-default" target="_blank" href="https://gamification.prestashop.com/get_advice_link.php?id_advice=508&url=http%3A%2F%2Faddons.prestashop.com%2Fen%2Fbilling-invoicing-prestashop-modules%2F5040-avalara-avatax.html%3Futm_source%3Dback-office%26utm_medium%3Dtipoftheday%26utm_campaign%3Dpartenariats%26utm_content%3Davalara">More information?</a>\n				</span>\n			</div>\n		</section>\n		<section id="5_avalara" class="panel " style="display:none">\n			<header class="panel-heading">\n				<span class="icon-lightbulb"></span> Tips of the day</header>\n			<div class="panel-body" style="padding:0">\n				<img class="img-responsive" src="https://api.prestashop.com/partner/tipsoftheday/img/logo-avalara.png" style="float:right; margin-left: 5px;">\n				<img src="https://gamification.prestashop.com/api/getAdviceImg/508.png"/>\n				<p><b>Are your customers’ tax exempt status updated?</b></p>\n				<p>Check that customers’ tax exempt status is updated and agrees with the term of their exemption certificate on file.</p>\n				<span class="text-right" style="float:right">\n					<a class="btn btn-default" target="_blank" href="https://gamification.prestashop.com/get_advice_link.php?id_advice=508&url=http%3A%2F%2Faddons.prestashop.com%2Fen%2Fbilling-invoicing-prestashop-modules%2F5040-avalara-avatax.html%3Futm_source%3Dback-office%26utm_medium%3Dtipoftheday%26utm_campaign%3Dpartenariats%26utm_content%3Davalara">More information?</a>\n				</span>\n			</div>\n		</section>\n		<section id="6_avalara" class="panel " style="display:none">\n			<header class="panel-heading">\n				<span class="icon-lightbulb"></span> Tips of the day</header>\n			<div class="panel-body" style="padding:0">\n				<img class="img-responsive" src="https://api.prestashop.com/partner/tipsoftheday/img/logo-avalara.png" style="float:right; margin-left: 5px;">\n				<img src="https://gamification.prestashop.com/api/getAdviceImg/508.png"/>\n				<p><b>What’s the average price to manage a sales tax audit?</b></p>\n				<p>It costs over $96k on average to manage a sales tax audit.</p>\n				<span class="text-right" style="float:right">\n					<a class="btn btn-default" target="_blank" href="https://gamification.prestashop.com/get_advice_link.php?id_advice=508&url=http%3A%2F%2Faddons.prestashop.com%2Fen%2Fbilling-invoicing-prestashop-modules%2F5040-avalara-avatax.html%3Futm_source%3Dback-office%26utm_medium%3Dtipoftheday%26utm_campaign%3Dpartenariats%26utm_content%3Davalara">More information?</a>\n				</span>\n			</div>\n		</section>\n		<section id="7_avalara" class="panel " style="display:none">\n			<header class="panel-heading">\n				<span class="icon-lightbulb"></span> Tips of the day</header>\n			<div class="panel-body" style="padding:0">\n				<img class="img-responsive" src="https://api.prestashop.com/partner/tipsoftheday/img/logo-avalara.png" style="float:right; margin-left: 5px;">\n				<img src="https://gamification.prestashop.com/api/getAdviceImg/508.png"/>\n				<p><b>Do you know the difference between an unsliced bagel and a sliced bagel, in New York?</b></p>\n				<p>Did you know that In New York, a bagel is sales taxes exempt, unless someone slices it for you, and then you have to pay sales tax?</p>\n				<span class="text-right" style="float:right">\n					<a class="btn btn-default" target="_blank" href="https://gamification.prestashop.com/get_advice_link.php?id_advice=508&url=http%3A%2F%2Faddons.prestashop.com%2Fen%2Fbilling-invoicing-prestashop-modules%2F5040-avalara-avatax.html%3Futm_source%3Dback-office%26utm_medium%3Dtipoftheday%26utm_campaign%3Dpartenariats%26utm_content%3Davalara">More information?</a>\n				</span>\n			</div>\n		</section>\n			<script>\n			$(document).ready( function () {\n				$(\'#\'+rand(7)+\'_avalara\').show();\n			});\n\n			function rand(nbr){\n			   return Math.floor(Math.random()*(nbr+1));\n			}\n			</script>\n			</div>'),
