(62, 1, '<div id="wrap_id_advice_679" >\n		<section id="0_liveperson" class="panel " style="display:none">\n			<header class="panel-heading">\n				<span class="icon-lightbulb"></span> Tips of the day</header>\n			<div class="panel-body" style="padding:0">\n				<img class="img-responsive" src="https://api.prestashop.com/partner/tipsoftheday/img/logo-liveperson.png" style="float:right; margin-left: 5px;">\n				<img src="https://gamification.prestashop.com/api/getAdviceImg/679.png"/>\n				<p><b>Do you know about real-time B2C messaging?</b></p>\n				<p>Real-time messaging capabilities let you reassure and convince more visitors and inspire brand loyalty, increasing your conversion rate by 20%.</p>\n				<span class="text-right" style="float:right">\n					<a class="btn btn-default" target="_blank" href="https://gamification.prestashop.com/get_advice_link.php?id_advice=679&url=http%3A%2F%2Fengage.liveperson.com%2Fprestashop%2F%3Futm_medium%3Dpartnerships%26utm_source%3Dprestashops%26utm_campaign%3Dlp-partners-prestashops%26utm_content%3Doptional">Start now</a>\n				</span>\n			</div>\n		</section>\n		<section id="1_liveperson" class="panel " style="display:none">\n			<header class="panel-heading">\n				<span class="icon-lightbulb"></span> Tips of the day</header>\n			<div class="panel-body" style="padding:0">\n				<img class="img-responsive" src="https://api.prestashop.com/partner/tipsoftheday/img/logo-liveperson.png" style="float:right; margin-left: 5px;">\n				<img src="https://gamification.prestashop.com/api/getAdviceImg/679.png"/>\n				<p><b>Display the most relevant offers to your visitors</b></p>\n				<p>Take advantage of targeted display campaigns combined with real-time messaging to increase your conversion rate.</p>\n				<span class="text-right" style="float:right">\n					<a class="btn btn-default" target="_blank" href="https://gamification.prestashop.com/get_advice_link.php?id_advice=679&url=http%3A%2F%2Fengage.liveperson.com%2Fprestashop%2F%3Futm_medium%3Dpartn