.9.5</td>\r\n<td>displayHomeTab</td>\r\n<td>1</td>\r\n</tr><tr><td>Specials block v1.1.5</td>\r\n<td>displayHomeTab</td>\r\n<td>2</td>\r\n</tr><tr><td>Top-sellers block v1.6.1</td>\r\n<td>displayHomeTab</td>\r\n<td>3</td>\r\n</tr><tr><td>Featured products on the homepage v1.6.3</td>\r\n<td>displayHomeTabContent</td>\r\n<td>1</td>\r\n</tr><tr><td>New products block v1.9.5</td>\r\n<td>displayHomeTabContent</td>\r\n<td>2</td>\r\n</tr><tr><td>Specials block v1.1.5</td>\r\n<td>displayHomeTabContent</td>\r\n<td>3</td>\r\n</tr><tr><td>Top-sellers block v1.6.1</td>\r\n<td>displayHomeTabContent</td>\r\n<td>4</td>\r\n</tr><tr><td>Image slider for your homepage v1.4.8</td>\r\n<td>displayTopColumn</td>\r\n<td>1</td>\r\n</tr><tr><td>Theme configurator v1.2.1</td>\r\n<td>displayTopColumn</td>\r\n<td>2</td>\r\n</tr><tr><td>Language block v1.3.3</td>\r\n<td>displayNav</td>\r\n<td>1</td>\r\n</tr><tr><td>Currency block v0.3.2</td>\r\n<td>displayNav</td>\r\n<td>2</td>\r\n</tr><tr><td>TM Header Account Block v1.0.0</td>\r\n<td>displayNav</td>\r\n<td>3</td>\r\n</tr><tr><td>Permanent links block v0.2.1</td>\r\n<td>displayNav</td>\r\n<td>4</td>\r\n</tr></tbody></table><h3>2. Configuring images</h3>\r\n<p>In PrestaShop you can use predefined image dimensions for product images, category images, manufacturers etc.</p>\r\n<p>For example, images of the <strong>\'home\'</strong> dimensions are usually used for the category listing product images, <strong>\'large\'</strong> for main product image on the product info page.</p>\r\n<p>To configure product image dimensions, open your PrestaShop admin panel, go to <strong>Preferences &gt; Images</strong> and set the image dimensions as displayed below:</p>\r\n<table class="table table-bordered table-hover"><tbody><tr><th>Picture</th><th>Width (px)</th><th>Height (px)</th></tr><tr><td>small_default</td>\r\n<td>98</td>\r\n<td class="presta_center">98</td>\r\n</tr><tr><td>medium_default</td>\r\n<td>125</td>\r\n<td class="presta_center">125</td>\r\n</tr><tr><td>home_default</td>\r\n<td>270</td>\r\n<td class="presta_center">270</td>\r\n</tr><tr><td>large_default</td>\r\n<td>458</td>\r\n<td class="presta_center">458</td>\r\n</tr><tr><td>thickbox_default</td>\r\n<td>800</td>\r\n<td class="presta_center">800</td>\r\n</tr><tr><td>category_default</td>\r\n<td>870</td>\r\n<td class="presta_center">217</td>\r\n</tr><tr><td>scene_default</td>\r\n<td>520</td>\r\n<td class="presta_center">189</td>\r\n</tr><tr><td>m_scene_default</td>\r\n<td>161</td>\r\n<td class="presta_center">58</td>\r\n</tr><tr><td>tm_home_default</td>\r\n<td>270</td>\r\n<td class="presta_center">270</td>\r\n</tr><tr><td>tm_large_default</td>\r\n<td>458</td>\r\n<td class="presta_center">458</td>\r\n</tr><tr><td>tm_small_default</td>\r\n<td>98</td>\r\n<td class="presta_center">98</td>\r\n</tr><tr><td>tm_cart_default</td>\r\n<td>80</td>\r\n<td class="presta_center">80</td>\r\n</tr><tr><td>tm_medium_default</td>\r\n<td>125</td>\r\n<td class="presta_center">125</td>\r\n</tr><tr><td>tm_thickbox_default</td>\r\n<td>800</td>\r\n<td class="presta_center">800</td>\r\n</tr><tr><td>tm_category_default</td>\r\n<td>870</td>\r\n<td class="presta_center">217</td>\r\n</tr><tr><td>cart_default</td>\r\n<td>80</td>\r\n<td class="presta_center">80</td>\r\n</tr></tbody></table></div>\r\n<div class="clearfix"> </div>\r\n</div>', 'pages-configuration'),
(7, 1, 1, 'How do I order', '', '', '<p class="bold font-size-20 primary-color"><span class="glyphicon glyphicon-arrow-right"></span> How to order online?</p>\r\n<p style="padding-left:50px;">To order from pimp-my-gift website, just click on the item you want to buy, select the design you want to display on it and place it on product through the layout maker tool, choose the color you’re after, and click “Add to my cart”. <br /> You can continue adding items to your bag and when done, click on “My Cart” in the top right hand corner to check out. You will need your credit card (Visa, Mastercard or Amex) details or a Paypal account to finalize your order, as well as your delivery address.</p>\r\n<p class="bold font-size-20 primary-color"><span class="glyphicon glyphicon-arrow-right"></span> Can I Cancel/change my order?</p>\r\n<p style="padding-left:50px;">Yes, you can change your order. To do so, click on “My cart” and click on the cross icon to cancel, or on “modify” to re-place the design or change product’s color. Once your order has been confirmed, however, you won’t be able to cancel or change it. Please have a read of our Returns Policy if you’d like more information on this.</p>\r\n<p class="bold font-size-20 primary-color"><span class="glyphicon glyphicon-arrow-right"></span> How can I pay my order?</p>\r\n<p style="padding-left:50px;">We accept VISA, MasterCard, AMEX and Pay Pal. Your card will be debited at the time of dispatch, and the transaction will appear on your statement as QCS Asia.</p>\r\n<p class="bold font-size-20 primary-color"><span class="glyphicon glyphicon-arrow-right"></span> What currency do you use?</p>\r\n<p style="padding-left:50px;">All prices have a default display in US dollars that includes GST. However, by selecting another flag you can change the currency to an approximation of cost in the currency you chose.<br /> All purchases are charged in US dollars. Other currencies are presented as an approximation only and are taken from the popular currency conversion website xe.com.</p>\r\n<p class="bold font-size-20 primary-color"><span class="glyphicon glyphicon-arrow-right"></span> How do I redeem a voucher or promo code online?</p>\r\n<ul style="list-style:decimal;padding-left:50px;"><li>Add items to your bag</li>\r\n<li>At the checkout, enter your rewards or promo code in the "promotion code" box</li>\r\n<li>Hit Apply.</li>\r\n</ul><p style="padding-left:50px;">Your code should now be applied to your cart. If not:</p>\r\n<ul style="list-style:decimal;padding-left:50px;"><li>Double check you’ve entered it correctly</li>\r\n<li>Make sure you’ve met the minimum spend requirements</li>\r\n<li>Check the expiry date to ensure it’s still valid</li>\r\n<li>If all else fails, please contact us</li>\r\n</ul><p class="bold font-size-20 primary-color"><span class="glyphicon glyphicon-arrow-right"></span> How secured is my credit card and my personal information?</p>\r\n<p style="padding-left:50px;">Your security while shopping online with pimp-my-gift.com is extremely important to us, and we have taken all reasonable measures to ensure that your credit card and personal details are kept safe at all times. <br /> All pages that require you to enter your personal information or payment details on our site are secure, using 128 bit SSL encryption. To ensure that the page you are viewing is secure, look for a padlock icon in your browser. This verifies the authenticity and validity of our website security.</p>\r\n<p class="bold font-size-20 primary-color"><span class="glyphicon glyphicon-arrow-right"></span> What is pimp-my-gift.com policy on exchange and refund?</p>\r\n<p style="padding-left:50px;">All the goods sold are subject to quality inspection and products are 100% personalized so pimp-my-gift.com don’t accept any exchange or refund. The only situation that can lead to a refund happens if some issues are encountered during the delivery process.</p>\r\n<p class="bold font-size-20 primary-color"><span class="glyphicon glyphicon-arrow-right"></span> Which countries does pimp-my-gift.com ship to?</p>\r\n<p style="padding-left:50px;">We can ship our products everywhere in the world (Except Yemen and Sierra Leone).</p>\r\n<p class="bold font-size-20 primary-color"><span class="glyphicon glyphicon-arrow-right"></span> How much will postage and packaging cost?</p>\r\n<p style="padding-left:50px;">Pimp-my-gift.com charges a flat rate of USD$10.00 for any purchase to be shipped anywhere in the world.</p>\r\n<p class="bold font-size-20 primary-color"><span class="glyphicon glyphicon-arrow-right"></span> Which courier company will you use?</p>\r\n<p style="padding-left:50px;">We use public post service to send your parcel, wherever you live. We can’t track your delivery but we send all the parcels with a receipt of acknowledgement so that we know when you get delivered, and we also know if you don’t. <br /> From recent studies, 99.8% of international courier handled by national post offices, get delivered on time and without complaint from any side (sender/receiver)</p>\r\n<p class="bold font-size-20 primary-color"><span class="glyphicon glyphicon-arrow-right"></span> If there is a problem with my order, who do I contact with?</p>\r\n<p style="padding-left:50px;">If there is a problem with your order, please email our team at info@pimp-my-gift.com</p>\r\n<p class="bold font-size-20 primary-color"><span class="glyphicon glyphicon-arrow-right"></span> How long will it take for my order to arrive?</p>\r\n<p style="padding-left:50px;">Orders should be delivered within 15 business days. Depending on where you live, it might be shorter.</p>\r\n<p style="padding-left:50px;">If your order has not arrived within the above time frame, email us at info@pimp-my-gift.com. Please make sure you indicate any special delivery instructions in the space provided on the delivery page at checkout.</p>\r\n<p class="bold font-size-20 primary-color"><span class="glyphicon glyphicon-arrow-right"></span> What countries do you deliver to?</p>\r\n<p style="padding-left:50px;">Anywhere</p>', 'how-do-i-order'),
