(22, 1, 1, '<p><span>The PKGH magnet badge works as a glass holder. It also comes in standard with microfiber screen cleaner pad. When you do not wear the badge and do not use it as a reading glass holder, you can hang it to your keys and make sure you always have it have it with you.</span></p>', '<p>The PKGH magnet badge works as a glass holder. It also comes in standard with microfiber screen cleaner pad. When you do not wear the badge and do not use it as a reading glass holder, you can hang it to your keys and make sure you always have it have it with you.</p>', 'plastic-glass-holder-badge-and-keychain-pkgh', '', '', '', 'Plastic glass holder badge and keychain', '', ''),
