(25, 1, 1, '<p><span>Innovative hook to hang keys and anything on. It can come with a magnet to be fitted on metal surface or with a silicon sticker for other surface. Plastic (ABS) material. Recessed (#RC203) 26 mm front side.</span></p>', '<p><span>Innovative hook to hang keys and anything on. It can come with a magnet to be fitted on metal surface or with a silicon sticker for other surface. Plastic (ABS) material. Recessed (#RC203) 26 mm front side.</span></p>', 'plastic-key-hanger-phm203', '', '', '', 'Plastic key hanger', '', ''),
