(468, 1, 1, '<p><span>The PSPH is a new line of I-ring or phone/mobile holder. Fix it on the back of any phone using a re-usable silicon sticker with no glue residue.</span><br /><span>The PSPH phone holder has a 360 orbital ring through which you can put your finger to conveniently hold your phone in any position with one single finger. It can also hold your phone on a table in panoramic view</span></p>', '<p><span>The PSPH is a new line of I-ring or phone/mobile holder. Fix it on the back of any phone using a re-usable silicon sticker with no glue residue.</span><br /><span>The PSPH phone holder has a 360 orbital ring through which you can put your finger to conveniently hold your phone in any position with one single finger. It can also hold your phone on a table in panoramic view</span></p>', 'bottle-and-can-opener-plastic-keychain', '', '', '', 'Smartphone ring holder', '', ''),
