(470, 1, 1, '<p><span>The PSS line is the plastic version of the zamac ZSS line of keychain with rubber loop. Push down the loop to open it and release a key, pull back to close the loop and fix the keychain. It comes with a recess on 1 side or both sides which fit standard (#ODD205) 20 mm size doming.</span><br /><span>Easy to use and functional, this promotional product is light and soft, it won’t scratch your car’s door or your mobile phone in your pocket.</span></p>', '<p><span>The PSS line is the plastic version of the zamac ZSS line of keychain with rubber loop. Push down the loop to open it and release a key, pull back to close the loop and fix the keychain. It comes with a recess on 1 side or both sides which fit standard (#ODD205) 20 mm size doming.</span></p>', 'plastic-loop-keychain', '', '', '', 'Plastic loop keychain', '', ''),
