(471, 1, 1, '<p><span>This custom revolving keychain is a great giveaway for either stock promotional product or made to order in Asia.</span><br /><span>Cheap and quick to logo custom with doming, it can also come with an optional silicon band that can be printed, thus greatly enlarging the logo area.</span><br /><span>Thanks to its innovative lock up system, the promotional pastic keychain with strap does not require screws that similar item do.</span></p>', '<p><span>This custom revolving keychain is a great giveaway for either stock promotional product or made to order in Asia.</span><br /><span>Cheap and quick to logo custom with doming, it can also come with an optional silicon band that can be printed, thus greatly enlarging the logo area.</span><br /><span>Thanks to its innovative lock up system, the promotional pastic keychain with strap does not require screws that similar item do.</span></p>', 'plastic-top-keychain-with-webbing-strap', '', '', '', 'Plastic top keychain with webbing strap', '', ''),
