(472, 1, 1, '<p><span>The PTOP line is a completely new and innovative keychain with trolley opener function. Contrary to other trolley &amp; coin keychain, it </span><span>does not need to stay on the trolley.</span><span> It just works like an opener and you can put it back in your pocket right after opening the trolley and releasing the chain.</span></p>', '<p><span>The PTOP line is a completely new and innovative keychain with trolley opener function. Contrary to other trolley &amp; coin keychain, it </span><span>does not need to stay on the trolley.</span><span> It just works like an opener and you can put it back in your pocket right after opening the trolley and releasing the chain.</span></p>', 'plastic-top-keychain-with-webbing-strap', '', '', '', 'Trolley opener plastic keychain', '', ''),
